const categoriesElem = document.querySelector('.wrapper')

const renderContent = (categories)=>{
    renderCategoryFilterOptions(categories)
    categories.forEach(category => {
        const html = renderCategory(category)
        categoriesElem.innerHTML += html
    });
}
const renderCategoryFilterOptions = (categories) =>{
    const optionsHtml = categories.map(category =>{
        return `<option value="${category.id}">${category.name}</option>`
    })
    categoriesElem.querySelector("select").innerHTML += optionsHtml.join("")
     
}
const renderCategory = (category) =>{
    const carListHtml = renderCarList(category.cars)
    return `
        <div class="category" data-id="${category.id}">
        <h2>${category.name}</h2>
        ${carListHtml}
        </div>
    `
}
const renderCarList = (cars) =>{
    const listItemsHtml = cars.map(car =>{
        const carHtml = renderCar(car)
        return carHtml
    })

    return `
        <ul>
            ${listItemsHtml.join("")}
        </ul>
    `
}

const renderCar = (car) =>{
    return `
    <li data-id="${car.id}">
        <img src="${car.image}" alt="">
        <span class="name">${car.name}</span>
        <span class="year">${car.manufacturedYear}</span>
        <span class="rating">${car.reviewRate}</span>
        <strong class="price">${formatCurrency(car.price) }</strong>
    </li>
    `
}
const formatCurrency = (number) => {
    return new Intl.NumberFormat("pt-Br", {style: 'currency', currency:"BRL"}).format(number)
}

(function(){
    renderContent(categories)
})()